import Link from "next/link";


const NavHeader = () => (
  <div className="header">
    <div className="logo-container">
      <Link href="/">
        <a>
          <img src="../static/images/logo.svg" alt="SCALE LOGO" />
        </a>
      </Link>
    </div>
    <div className="mid-col">
      <ul>
        <li>About</li>
        <li>Blog</li>
        <li>Profit Calculator</li>
      </ul>
    </div>
    <div className="r-col">
      <ul>
        <li>
          <span className="dark-btn">SIGN UP</span>
        </li>
        <li>
          <span className="dark-btn">LOG IN</span>
        </li>
      </ul>
    </div>

    <style jsx>{`
      .header {
        display: grid;
        grid-template-columns: 1fr 2fr 1fr;
      }
      .header ul {
        list-style: none;
      }
      .logo-container {
        display: flex;
        align-items: center;
      }

      .mid-col ul {
        display: grid;
        grid-template-columns: repeat(3, 1fr);
      }
      .r-col ul {
        display: grid;
        grid-template-columns: repeat(2, 1fr);
        grid-column-gap: 5px;
      }
      .dark-btn {
        background: black;
        box-shadow: 5px 10px 10px rgba(0, 0, 0, 0.25);
        border-radius: 16px;
        padding: 5px 10px;
        style: none;
        color: white;
        transition: 1.2s cubic-bezier(0.2, 0.8, 0.2, 1);
        font-weight: 700;
      }
    `}</style>
  </div>
);

export default NavHeader;
